import styled from "styled-components";
import { Link } from "react-router-dom";
import LogoIMG from "../img/new_logo_nobackground.png";
import HumanIMG from "../img/humanicon.png";

const HeaderContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  height: 12rem;
  min-height: 200px;
  position: absolute;
  top: 0rem;
  border: 1px solid black;
  background-color: var(--cream);
  padding: 0 2rem;
`;

const MainLogo = styled.img`
  width: 190px;
  height: 190px;
  max-height: 12rem;
  z-index: 99;
  position: absolute;
  top: 0;
  left: 5%;
`;

const MyPageContainer = styled.div`
  display: flex;
  align-items: center;
  gap: 1rem;
`;
const IconContainer = styled.div`
  width: 150px;
  height: 150px;
  max-height: 12rem;
  background-color: white;
  border: 2px solid var(--border);
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
`;
const HumanIcon = styled.img`
  width: 70%;
`;
const MyPageTitle = styled.span`
  font-size: 8rem;
`;
function Header() {
  return (
    <HeaderContainer>
      <Link to={"/"}>
        <MainLogo src={LogoIMG} alt="Main Logo" />
      </Link>
      <Link to={"/my_page"}>
        <MyPageContainer>
          <IconContainer>
            <HumanIcon src={HumanIMG} alt="Human Incon" />
          </IconContainer>
          <MyPageTitle>마이페이지</MyPageTitle>
        </MyPageContainer>
      </Link>
    </HeaderContainer>
  );
}

export default Header;
